import React from "react";
import "./header.css";
import ReactBootstrap, {Nav, Button, Navbar,NavDropdown,Form,FormControl} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import Scrollchor from 'react-scrollchor';
import firebase from './fire';
import {withRouter} from 'react-router-dom';

function LoginLinks(props){
    return(
        <div>
        <Nav className="mr-auto">  {/* for the left side of navbar*/}
  
              <li className="nav-item active">
              <Scrollchor  className="nav-link" to="to-menu" style={{background: "#955F61",color: "white"}}>Menu</Scrollchor >
            </li>
            <li className="nav-item">
              <Scrollchor  className="nav-link" to="to-services" style={{background: "#955F61",color: "white"}}>Services</Scrollchor >
            </li>
            <li className="nav-item">
              <Scrollchor  className="nav-link" to="to-about" style={{background: "#955F61",color: "white"}}>About Us</Scrollchor >
            </li>
              </Nav>
             <Nav className="ml-auto">  {/* for the right side of navbar*/}
              <li className="nav-item active">
              <Scrollchor  className="nav-link" to="to-deals" style={{background: "#955F61",color: "white",marginTop:"10px"}}>Deals</Scrollchor >
            </li>
            <li className="nav-item active">
              <a  className="nav-link" href="/loginpage" style={{background: "#955F61",color: "white",marginTop:"10px"}}>helloo {firebase.getCurrentUsername()}</a >
            </li>
            <li className = "nav-item">
              <button className="btn" onClick={logout} style={{background: "#955F61",color: "white",marginTop: "11px"}}>Log Out</button>
            </li>
            <li className = "nav-item">
              <button className="btn"><i className="fa fa-search" style={{background: "#955F61",color: "white",marginTop: "11px"}}></i></button>
            </li>
            <li className="nav-item">
              <a type = "button" id = "GFG" href="https://www.facebook.com/uzmascuisine/" className="fa fa-facebook" style={{background: "#955F61",color: "white",marginTop: "18px"}}></a >
            </li>
            <li className="nav-item">
              <a type = "button" id = "GFG"  href="https://www.instagram.com/bonappetempt.pk/" className="fa fa-instagram" style={{background: "#955F61",color: "white",marginTop: "18px"}}></a >
            </li>
    
            </Nav>
            </div>
            
    );

    async function logout() {
        await firebase.logout();
		props.history.push('/');
	}
}

export default withRouter(LoginLinks);
